        </div>
      <div className="login">
        <h1>LOGIN</h1>
        <div className="userlog">
          <input type="text" />
        </div>
        <div className="passlog">
          <input type="text"  placeholder="Password"/>
        </div>
        <button>Sumbit</button>
      </div>
    </section>
  );
};

export default Login;
